import React from 'react';
import {Container} from "@material-ui/core";
import './third.css';

const Third = () => {
    return (
        <div className='third'>
            <Container>
                <div className="titleThird">
                    <h3>Лучшие сорта кофе</h3>
                    <p>Наши специалисты имеют большой, многолетний опыт в обжарке зеленого кофе</p>
                </div>
            </Container>
        </div>
    );
};

export default Third;
